  JSEWELL, Kay William Warneford and ATKIN, Janet Ellen
  SEWELL, Kay William Warneford and ATKIN, Janet Ellen (cont...)
  Napier and worked as a law clerk. During her time in Napier she was involved with the Presbyterian
  Sunday School, played netball (captaining a team which won the B grade competition), badminton, tennis
  and softball, and was a member of the Napier Sailing Club. In 1953 she returned to Gisborne,
  continuing to work as a law clerk.
  Following her marriage, Janet took up an active interest in gardening (especially vegetables) and was
  involved in the Patutahi Parent Teacher Association. She is now enjoying her retirement years and is a
  keen member of the Gisborne Horticultural Society, the Gisborne Garden Club, the Gisborne Canoe and
  Tramping Club, and Sport Eastland's 50s Forward Group.
  01> SEWELL, Grant Kay
  b 27.09.1962
  Grant b. at Gisborne. Address: 592 Wharekopae Road, RD 2, Gisborne.
  Grant was educated at Patutahi Primary School and Gisborne Boys' High School,
  graduated BAgSc from Massey University then worked in Hamilton for Winstone Ltd in
  1985-86. He moved to Sydney and for two years was involved in the construction of
  several irrigation systems, including Bicentennial Park (Homebush Bay) and the
  Sydney Football Stadium. He then worked as a sales engineer for Toro Australia Pty
  Ltd, mostly involved with golf courses, until his return to New Zealand in 1992. Since then he has
  been involved in the refurbishment of the family home and farm (Whaiti), overseas travel (South
  East Asia, United Kingdom, Austria, South Africa and Ireland), and a brief stint back in Sydney as
  a consultant for an engineering services company (involved with the Sydney 2000 Olympic site).
  Grant enjoys skiing, squash, scuba diving, hunting and fishing.
  02> SEWELL, Hillary Janet
  b 20.11.1964
  Hillary b. at Gisborne. Address: 1 Firth Road, Grey Lynn (PO Box 109371, Newmarket), Auckland.
  Hillary received her primary and secondary education in Gisborne. In 1983 she moved to Auckland
  and attended Auckland University. She graduated BA in Archaeology and Ancient History and also
  gained a Post-Graduate Diploma in Marketing. She has worked in various marketing management roles
  with several companies and has now set up her own marketing consultancy company.
  03> SEWELL, Dinah Eketuranga m on 21.05.1955 to DUGDALE, Alan Ellis
  b 10.10.1929
  b 29.03.1930
  Dinah b. at Gisborne and m. at Holy Trinity Church, Gisborne. Alan, slo John Ellis Dugdale and Mary
  Whiteley. Dinah's birthdate was the birthday of her grandfather and also the day of his consecration as
  a Bishop. She was given her Maori name as a tribute to the family from the Maori people. Address: 71
  McCaul Street, Taringa 4068, Brisbane, Australia.
  Dinah attended Gisborne High School and has a Diploma in Medical Technology, 1953. She is a member of
  the Queensland Embroiderers' Guild.
  Alan was educated at Timaru Boys' High School and Otago University. He was a Medical Officer in the
  British Colonial Service in Fiji (1955-57) then graduated MRACP (1958) and MD (Otago, 1960). He was
  Medical Officer at Princess Margaret Hospital for Children, Perth, Western Australia (1960-63);
  Lecturer in Child Health at the University of Queensland (1963-67); Professor of Paediatrics at the
  University of Malaya (1967-72); Associate Professor of Child Health at the University of Queensland
  (1972-91). He received the awards Datuk Paduka Makhota and Johan Setia di-Raja in Malaysia.
